              <input
                class="form-check-input"
                type="checkbox"
                value=""
                id="form2Example31"
                checked
              />
              <label class="form-check-label" for="form2Example31">
                {" "}
                Remember me{" "}
              </label>
            </div>
          </div>

          <div class="col">
            <a href="#!">create account</a>
          </div>
        </div>

        <button type="button" class="btn btn-primary btn-block mb-4">
          Sign in
        </button>
      </form>
    );
  }
}
export default AuthentificationComponent;
